  async init() {
    this.challenges = await CTFd.pages.challenges.getChallenges();
    this.loaded = true;

    if (window.location.hash) {
      let chalHash = decodeURIComponent(window.location.hash.substring(1));
      let idx = chalHash.lastIndexOf("-");
      if (idx >= 0) {
        let pieces = [chalHash.slice(0, idx), chalHash.slice(idx + 1)];
        let id = pieces[1];
        await this.loadChallenge(id);
      }
    }
    this.initPaths();
  },

  initPaths() {
    let svgElement = document.getElementById("mySVG");
    console.log("?entre");
    console.log(this.challenges[0]);
    console.log("?entre2");

    this.dValues.forEach((dValue, index) => {
      let pathElement = document.createElementNS("http://www.w3.org/2000/svg", "path");
      let challenge = this.challenges[index];

      // Si hay un challenge correspondiente para este índice, establece los atributos relacionados
      if (challenge) {
        console.log("?" + challenge.id);
        pathElement.setAttribute("data-challenge-id", challenge.id);
        pathElement.addEventListener("click", () => this.loadChallenge(challenge.id));
        pathElement.setAttribute("cursor", "pointer"); // Cambia el cursor a "pointer" cuando es clickeable
        pathElement.setAttribute("fill", "black");
      } else {
        pathElement.setAttribute("opacity", "0.5"); // Lo pone más gris si no hay challenge
        pathElement.setAttribute("cursor", "default"); // Cursor por defecto si no es clickeable
        pathElement.setAttribute("pointer-events", "none"); // Deshabilita eventos de ratón
        pathElement.setAttribute("fill", "gray");
        pathElement.setAttribute("filter", "url(#f1)");
        pathElement.setAttribute("style", "user-select: none; cursor: default;");
      }

      pathElement.setAttribute("d", dValue);
      svgElement.appendChild(pathElement);
    });
  },

  handleChallengeClick(event) {
    console.log("handleChallengeClick called");
    const challengeId = event.target.getAttribute("data-challenge-id");
    this.loadChallenge(challengeId);
  },

